import ExampleCarouselImage from 'components/ExampleCarouselImage';
import 'bootstrap/dist/css/bootstrap.min.css';
// import Image from 'react-bootstrap/Image';

const AboutPage = () => {
  return (
    <div className="about-container">
    <div className="about-intro"><h1 className="about-txt">About me</h1></div>
     <div className="about-bg">
      <div className="img-img">
      {/* <Image src="https://i.postimg.cc/wvhMfVkZ/Parrot.jpg"  fluid className="img-image"/> */}
      </div>
    </div>
    <Carousel fade>
    <Carousel>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src="image1.jpg"
      alt="First slide"
    />
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src="image2.jpg"
      alt="Second slide"
    />
  </Carousel.Item>
</Carousel>
    </Carousel>

    </div>
  )
}

export default AboutPage;
